                    // e.preventDefault();
                    searchInputDataValue = searchInputData.value.toLowerCase().trim();
                    if(searchInputDataValue !="") {
                        storeGlobalSearchData(searchInputDataValue);
                        runGlobalSearchQuery();
                    }
